import React from 'react';
import './Profile.css';

import { Link } from 'react-router-dom';

const Account = () => {
    return(
        <div className="profileLinks">
            <Link to='#'>Profil</Link>
            <Link to={'/instillinger'}>Innstillinger</Link>
            <Link to={'/meldinger'}>Meldinger</Link>
            <Link to={'mine-annonser'}>Mine Annonser</Link>
            <Link to={'/favoritter'}>Favoritter</Link>
            <Link to={'lagrede-sok'}>Lagrede Søk</Link>
        </div>     
    )
}

export default Account;
